import React from 'react';
import styles from './Info.module.css';
import Image from 'next/image';
const Info = () => {
  return (
    <div className={styles.information}>
      <div className={styles.iceCreamImage}>
        <Image
          src="/shockedboy.png"
          alt="surprised boy"
          width={340}
          height={390}
        />
      </div>
      <div className={styles.infoTextContainer}>
        <div className={styles.infoText}>
          "If you have spent your life in search of an answer look no further.
          This is simply the solution to all of life's problems" -
          <br />
          <span className={styles.magazine}>TIME</span>
        </div>
      </div>
    </div>
  );
};

export default Info;
